import ReactDOM from "react-dom";
import App from "./App";
import {store} from "./redux/main";

export const render = () => {
    ReactDOM.render(
        <React.StrictMode>
            <App store={store.getState().todos}/>
        </React.StrictMode>,
        document.getElementById("root")
    )
}
store.subscribe(render)
render()
